/** TODO:Change the path to entries.csv **/
val src = "/pr/input/entries.csv"

val diseases = List("Atelectasis","Cardiomegaly","Consolidation","Edema","Effusion","Emphysema","Fibrosis","Hernia","Infiltration","Mass","Nodule","Pleural_Thickening","Pneumonia","Pneumothorax")

case class Disease(image: String, age: Int, gender: String, view:String, Atelectasis : Int, Cardiomegaly : Int, Consolidation : Int, Edema : Int, Effusion : Int, Emphysema : Int, Fibrosis : Int, Hernia : Int, Infiltration : Int, Mass : Int, Nodule : Int, Pleural_Thickening : Int, Pneumonia : Int, Pneumothorax:Int)

def label(input:String, index:Int)={
    if (input.contains(diseases(index))) 1 else 0
}


val entries = sc.textFile(src).
              mapPartitionsWithIndex { (idx, iter) => if (idx == 0) iter.drop(1) else iter }
              .map(f=>f.split(","))
              .map(f=>Disease(f(0),f(4).toInt, f(5), f(6) , label(f(1),0),label(f(1),1),label(f(1),2),label(f(1),3),label(f(1),4),label(f(1),5),label(f(1),6),label(f(1),7),label(f(1),8),label(f(1),9),label(f(1),10),label(f(1),11),label(f(1),12),label(f(1),13)))
              .toDF()

entries.registerTempTable("Diseases")
